input_str = "\\\\"
lines = input_str.split()

keypad = "  1   234 56789 ABC   D  "

index = keypad.find("5")
code = ""

width = 5
height = 5

for line in lines:
    for c in line:
        if c == "U":
            if index - height >= 0 and keypad[index - height] != " ":
                index -= height
        elif c == "D":
            if index + height < width * height and keypad[index + height] != " ":
                index += height
        elif c == "L":
            if index % width != 0 and keypad[index - 1] != " ":
                index -= 1
        elif c == "R":
            if index % width != width - 1 and keypad[index + 1] != " ":
                index += 1

    code += keypad[index]

print(code)
